class Solution {
  int maximumSum(List<int> nums) {
    Map<Map<int, int>, int> primeFactorsSum = {};
    int maxSum = 0;
    for (int num in nums) {
      Map<int, int> factors = _getPrimeFactors(num);
      Map<int, int> reducedFactors = {};
      for (var entry in factors.entries) {
        if (entry.value % 2 != 0) reducedFactors[entry.key] = 1;
      }
      bool found = false;
      for (var key in primeFactorsSum.keys) {
        if (_canCombine(key, reducedFactors)) {
          primeFactorsSum[key] = primeFactorsSum[key]! + num;
          maxSum = maxSum < primeFactorsSum[key]! ? primeFactorsSum[key]! : maxSum;
          found = true;
          break;
        }
      }
      if (!found) {
        primeFactorsSum[reducedFactors] = num;
        maxSum = maxSum < num ? num : maxSum;
      }
    }
    return maxSum;
  }

  Map<int, int> _getPrimeFactors(int num) {
    Map<int, int> factors = {};
    for (int i = 2; i * i <= num; i++) {
      while (num % i == 0) {
        factors[i] = (factors[i] ?? 0) + 1;
        num ~/= i;
      }
    }
    if (num > 1) factors[num] = (factors[num] ?? 0) + 1;
    return factors;
  }

  bool _canCombine(Map<int, int> a, Map<int, int> b) {
    for (var entry in a.entries) {
      if (b.containsKey(entry.key) && b[entry.key] != entry.value) return false;
    }
    return true;
  }
}
